ith Operations to make sure the connection with DFA is correct.</div></div><div><br></div><div>For the cases that you currently have, please send along the appropriate QA results for review.</div><div><br></div><div>If you have questions about what I've laid out here or the process, please let me know.</div><div><br></div><div>Cheers</div>	332	2014-04-10 03:50:11.138	2014-04-10 03:50:11.138	\N	\N
