935	Events::NoteOnWorkspace	8	\N	\N	2014-06-17 19:20:49.819	2014-06-17 19:20:49.819	\N	\N	{"body":"Hi everyone, we are very close to implementing the automatic load process that we have been developing for the past month or so. &nbsp;To that end, I want to stress a few points that will become very important once this process goes live...<div><br></div><div>1) &nbsp;Our process will delete all current data for each campaign that is included in the load file starting at the minimum date and ending at the maximum date per campaign. &nbsp;For example, if we load a file that has data for \\"Campaign A\\" for 1/2, 1/3, and 1/7, all data will be removed from the database for \\"Campaign A\\" from 1/2 - 1/7, with the current load replacing those lines. &nbsp;Thus, if SS data needs to be corrected, it must be corrected for an entire concrete date range per campaign.</div><div><br></div><div>That said, each campaign will be treated as having its own minimum and maximum date, so it is OK to load different campaigns with different date ranges in the same file.</div><div><br></div><div>2) &nbsp;We will no longer be removing duplicate rows from a single load. &nbsp;@Jyoti, last week we caught a problem where the data you had compiled for central campaigns was sent to us with duplicate rows. &nbsp;In the future these rows will not be deduplicated and this will have to be caught via QA and re-uploaded for the entire date range/campaigns affected if duplication occurs.</div><div><br></div><div>3) &nbsp;@Tim, much like SS data, offline data must start coming in as a .csv file with a very specific column format. &nbsp;@Garrett will upload a template that must be followed exactly for offline (we may already have this in place... but I don't think we've been as stringent with it as we have with SS templates).</div><div><br></div><div>4) &nbsp;Now that this process is being automated we need to be very sure that column orders are being followed properly and we are not including bad characters (commas, dollar signs, etc.). &nbsp;Jyoti and Tim, I would recommend setting up some sort of quick formula in Excel that you can use to make sure the headers are in the correct order for each load.</div><div><br></div><div>If columns continue to get mis-ordered, particularly if the data underneath those that are switched is of the same data type (for instance, clicks and imps get switched but they are both integer values), it will become increasingly difficult to catch with the manual loads stopping.</div><div><br></div><div>Thanks everyone,</div><div><br></div><div>Andy</div>"}	4	\N	\N	\N	f	\N	\N	f	\N	\N
